// // // - Создать список комментариев, пример объекта коментария -
// // // {title : 'lorem', body:'lorem ipsum dolo sit ameti'}.
// // // Вывести список комментариев в документ, каждый в своем блоке.
// // // Добавьте каждому комментарию по кнопке для сворачивания его body.


let commentsArr = [
    {title: 'Коментарик №1', body: 'Тіло коментарика № 1'},
    {title: 'Коментарик №2', body: 'Тіло коментарика № 2'},
    {title: 'Коментарик №3', body: 'Тіло коментарика № 3'},
    {title: 'Коментарик №4', body: 'Тіло коментарика № 4'},
    {title: 'Коментарик №5', body: 'Тіло коментарика № 5'},
    {title: 'Коментарик №6', body: 'Тіло коментарика № 6'}
];

const commentsDiv = document.getElementById('comments')
commentsArr.forEach((comment) => {

    const div = document.createElement('div');

    const h2 = document.createElement('h2');
    h2.innerText = comment.title;
    commentsDiv.appendChild(h2);

    const bodyCommentP = document.createElement('p');
    bodyCommentP.innerText = comment.body;
    bodyCommentP.style.display = 'none';
    commentsDiv.appendChild(bodyCommentP);

    const button = document.createElement('button');
    button.innerText = 'Показати тіло коментарика';
    commentsDiv.appendChild(button);

    button.onclick = () => {

        if (bodyCommentP.style.display === 'none') {
            bodyCommentP.style.display = 'block';
            button.innerText = 'Сховати тіло коментарика';
        } else {
            bodyCommentP.style.display = 'none';
            button.innerText = 'Показати тіло коментарика'
        }
    }

    div.appendChild(h2);
    div.appendChild(bodyCommentP);
    div.appendChild(button);
    commentsDiv.appendChild(div);
});


